import webbrowser
from tkinter import Button, Canvas, Frame, Label, Text, Tk, filedialog
from tkinter.constants import DISABLED, INSERT, LEFT, NORMAL
import base64
import os
from PIL import Image, ImageTk

from getAnimal import *


#选择图片函数
def selectImg():
    global img
    img = None
    try:
        img = filedialog.askopenfile(
            filetypes=[('Image', '*.jpg'), ('Image',
                                            '*.png'), ('Image', '*.jpeg')])
    except:
        logger.error('Select Picture Failed')
    if img != None:
        animal_info = get(img.name)
        img = Image.open(img.name).resize((300, 135))
        img = ImageTk.PhotoImage(img)
        label_img = Label(image=img, width=300, height=160)
        label_img.place(x=135, y=25)
        showDescription(animal_info)


#展示信息函数
def showDescription(animal):

    name.config(text=animal['name'])
    if animal['none'] != True:
        #打开百度百科按钮
        openUrl = Button(
            window,
            bd=0,
            highlightthickness=0,
            relief="ridge",
            text='点击查看百科',
            font=(('微软雅黑', 10)),
            command=lambda: webbrowser.open(url=animal['baike_url'], new=1))
        openUrl.place(x=570.0, y=100.0, width=200.0, height=40.0)
        animal_description.config(state=NORMAL)
        animal_description.delete('1.0', 'end')
        animal_description.insert(INSERT, animal['animal_description'])
        animal_description.config(state=DISABLED)
    else:
        animal_description.config(state=NORMAL)
        animal_description.delete('1.0', 'end')
        animal_description.insert(INSERT, '无相关资料')
        animal_description.config(state=DISABLED)
        cite = Label(window, text='无相关百科', font=(('微软雅黑', 10)))
        cite.place(x=570.0, y=100.0, width=200.0, height=40.0)


window = Tk()
window.title('动物识别')
temp = open('temp.ico', 'wb+')
temp.write(
    base64.b64decode(
        ''
    ))
temp.close()
window.iconbitmap('temp.ico')
os.remove('temp.ico')
window.geometry("1000x600")

window.configure(bg="#FFFFFF")
frame_menu = Frame(window, bg='#FFF', width=120)
frame_menu.pack(side=LEFT, fill='y')
#选择图片按钮
select_button = Button(
    frame_menu,
    text='选择图片',
    borderwidth=0,
    bg='#c4c4c4',
    font=(('微软雅黑', 13)),
    highlightthickness=0,
    command=selectImg,
)
select_button.pack(padx=3, pady=5)
#名称，百度百科按钮
label_name = Label(anchor="nw", text="名称:", bg="#FFF", font=(("微软雅黑", 14)))
label_name.place(x=500, y=27, width=60)
label_baike = Label(anchor="nw", text="百科:", bg="#FFF", font=(("微软雅黑", 14)))
label_baike.place(x=500, y=100, width=60)

name = Label(bd=0, bg="#FFF", highlightthickness=0)
name.place(x=570.0, y=27.0, width=200.0, height=40)
#动物简介文本框
animal_description = Text(
    window,
    bd=0,
    bg="#fff",
    highlightthickness=0,
    font=(('微软雅黑', 10)),
)

animal_description.place(x=200, y=230, height=500, width=700)

window.resizable(False, False)
window.mainloop()
